// Starter code for the front-end, includes examples of accessing all server
// API routes with AJAX requests.

import "./App.css";
import Pets from "./Components/Pets";
import { BrowserRouter as Router, Route, NavLink } from "react-router-dom";
import Home from "./Components/Home";
import Inventory from "./Components/Inventory";
import Search from "./Components/Search";
import About from "./Components/About";

// Material UI is included in the install of the front end, so we have access
// to components like Buttons, etc, when we import them.

function App() {
  return (
    <Router>
      <div>
        {/* Navigation */}
        <nav>
          <ul>
            <li>
              <NavLink exact to="/" activeClassName="active">
                Home
              </NavLink>
            </li>
            <li>
              <NavLink to="/inventory" activeClassName="active">
                Inventory
              </NavLink>
            </li>
            <li>
              <NavLink to="/search" activeClassName="active">
                Search
              </NavLink>
            </li>
            <li>
              <NavLink to="/about" activeClassName="active">
                About
              </NavLink>
            </li>
          </ul>
        </nav>

        {/* Routes */}
        <Route path="/" element={<Home />} />
        <Route path="/inventory" element={<Pets />} />
        <Route path="/search" element={<Search />} />
        <Route path="/about" element={<About />} />
      </div>
    </Router>
  );
}

export default App;
